import React, { Component } from 'react';

const Arrow = ({ position, left, top, width, height }) => (
  <i
    className='fas fa-arrow-circle-up '
    style={{
      position: position,
      left: left,
      top: top,
      width: width,
      height: height
    }}
  ></i>
);

export class Static extends Component {
  render() {
    return (
      <div>
        <Arrow heigth='150px' />
      </div>
    );
  }
}

export default Static;
